		if(dlToStakeDTO==null){
			return toStakeResponseDTO;
		}
		toStakeResponseDTO.setRetCode(dlToStakeDTO.getErr().getCode());
		toStakeResponseDTO.setRetDesc(dlToStakeDTO.getErr().getDes());
